host_about:
Happy host at Honey House on the Hill B&B, Washington, DC;
Mother/grandmother/sister/friend;
Love to entertain, arrange flowers and cook...with ease and an artistic eye;
Educator, current projects: Leadership and Integrity, public communication, senior health care; School for Ethics and Global Leadership;
Community volunteer: Folger Shakespeare Library, Korean War Veterans Memorial, church, usher at local theaters, active with international women's group; World-wide traveler, sailor, interested in cultural history and the great outdoors
